import React, {
    useEffect,
    useState
} from 'react'
import { Col, Row, Container, Input, Label, Button, Alert } from 'reactstrap'
import { Link } from 'react-router'

const Register = () => {

    const [name, setName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [passwordRepeat, setPasswordRepeat] = useState("");
    const [error, setError] = useState(false);

    useEffect((() => {
        if (password === setPasswordRepeat) {
            setError(true);
        }
    }))

    console.log(password, passwordRepeat);




    return (
        <Container >
            <Row className='mb-4'>
                <Col md={{ size: 6, offset: 3 }}>
                    <h1>Kayıt Ol ! </h1>
                </Col>
            </Row>
            <Row>
                <Col md={{ size: 3 }}>
                </Col>
                <Col md={{ size: 6 }}>

                    <Row>
                        <Col md={{ size: 6 }} className='mb-3'>
                            <Label>Adınız </Label>
                            <Input className='input_login' placeholder="Lütfen Adınızı Girin ! "
                                value={name}
                                onChange={e => setName(e.target.value)}
                            ></Input>
                        </Col>
                        <Col md={{ size: 6 }} className='mb-3'>
                            <Label>Email </Label>
                            <Input className="input_login" placeholder="Lütfen Email Girin ! "
                                value={email}
                                onChange={e => setEmail(e.target.value)}

                            ></Input>
                        </Col>
                    </Row>
                    <Row>
                        <Col md={{ size: 12 }} className='mb-3'>
                            <Label>Şifre </Label>
                            <Input className='input_login' placeholder="Lütfen Şifre Girin ! "
                                value={password}
                                onChange={e => setPassword(e.target.value)}
                            ></Input>
                        </Col>
                        <Col md={{ size: 12 }} className='mb-3'>
                            <Label>Şifre Tekrarı</Label>
                            <Input className="input_login" placeholder="Lütfen Şifrenizi Tekrar Girin ! "
                                value={passwordRepeat}
                                onChange={e => setPasswordRepeat(e.target.value)}

                            ></Input>
                        </Col>
                        {
                            error ? <Alert className='error'>Şifreler uyuşmuyor!</Alert> : ''
                        }
                    </Row>
                    <Row>
                        <Col md={{ size: 6 }} className='mb-3 w-100'>
                            <Button className='btn-login'>Giriş Yap </Button>
                        </Col>
                    </Row>
                    <Row>
                        <Col md={{ size: 6 }}>
                            <p>Hesabınız var mı? <span><Link to='/login'>Giriş Yap</Link></span></p>
                        </Col>
                    </Row>
                </Col>
                <Col md={{ size: 3 }}>
                </Col>

            </Row>


        </Container >
    )
}

export default Register
